<!DOCTYPE html><html><head><meta charset="utf-8"/><meta name="viewport"content="width=device-width,initial-scale=1.0,maximum-scale=1.0,minimum-scale=1.0,user-scalable=no"/><title>广州淘金劲索大波大屎忽狂野多汁鬼妹</title><link rel="stylesheet"href='../style/resrouce.css'type="text/css"/></head><body><div id="container"><h3>广州淘金劲索大波大屎忽狂野多汁鬼妹</h3><p>开价30张，讲价讲到15张，搭讪识既，未试过，望落应该系欧亚混血，一睇距个死人嘴就知道含柒绝对舒服，老规矩，第一个去验证并且翻黎汇报既有奖励，未见到人唔会比钱，去到见到唔对路马上走，英文唔好唔识讲价既唔好玩，最近条女穷，有无善心人士去救助距？</p><div></div></div><script type="text/javascript">var images=JSON.parse('["1744168729089.jpeg","1744168732787.jpeg","1744168736518.jpeg","1744168740058.jpeg"]');</script><script type="text/javascript"src="../script/dest/resource.js"></script></body></html>
